import Link from 'next/link';

const Navbar=()=>(
    <div>
        <ul>
            <li><Link href="/home"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
        </ul>

        <style jsx>{`
            ul {
                background : #444
            }
        `}</style>
    </div>
)

export default Navbar;
